import './Footer.css';

export default function Footer() {

    return (
        <div className='footer-container'>
            <div className='footer-parent'>
                <img src={require('../../../assets/Home/bg3.jpeg').default} alt='no internet connection' />
            </div>
        </div>
    )
}
